(2522, 317, 'art1-text', '<h4 class=\"col-12\">Sobre Mascotto</h4>\n<div class=\"col-sm-7\">\n<p><b>Mascotto</b> es una nueva cadena de tiendas de animales en España.</p>\n<p>En <b>Mascotto</b> somos especialistas en perros y gatos, pero poco vamos ampliando nuestro catálogo de productos y expandiéndonos hacia otros animales. Tenemos un equipo de personas dedicadas a ayudar a mejorar la vida de todas las mascotas, pues un amante de los animales no es sólo un cliente, es un amigo.</p>\n<p>Para ayudarte a cuidar y disfrutar de tu mejor amigo contamos con las mejores ofertas del sector y con el personal más especializado.</p>\n</div>\n<p>&lt;!--\n\n\n<div class=\"img-par-1 col-5\"></div>\n\n\n--&gt;</p>\n'),
(2523, 24, '_last_editor_used_jetpack', 'classic-editor'),
(2524, 22, 'art1-text', '<h4 class=\"col-12 bg-dark\">Sobre Mascotto</h4>\n<div class=\"col-sm-7\">\n<p> <b>Mascotto</b> es una nueva cadena de tiendas de animales en España.</p>\n<p> En <b>Mascotto</b> somos especialistas en perros y gatos, pero poco vamos ampliando nuestro catálogo de productos y expandiéndonos hacia otros animales. Tenemos un equipo de personas dedicadas a ayudar a mejorar la vida de todas las mascotas, pues un amante de los animales no es sólo un cliente, es un amigo.</p>\n<p> Para ayudarte a cuidar y disfrutar de tu mejor amigo contamos con las mejores ofertas del sector y con el personal más especializado.\n</p>\n</div>\n<p>&lt;!-- </p>\n<div class=\"img-par-1 col-5\"></div>\n<p>--&gt;</p>\n'),
