(2631, 334, 'art1-text', '<h1>POLÍTICA DE COOKIES</h1>\n<p>En Kiwoko.com utilizamos unos pequeños archivos de texto que se almacenan en tu ordenador, conocidos comúnmente como cookies. Éstas nos ayudan a hacer seguimientos sobre los productos que has guardado o añadido a la cesta de la compra y así poder recordarte cuando regreses a la página.</p>\n<p>Para hacer un pedido en Kiwoko.com, las cookies deberían estar habilitadas para un correcto funcionamiento. Sin embargo, si lo único que quieres es darte una vuelta por la página sin comprar, puedes deshabilitarlas con total libertad.</p>\n<p>Utilizamos cookies para ayudarte en tu recorrido por la web y las cookies que usamos son seguras. La información que recogemos con las cookies nos ayuda a identificar cualquier error que tengamos, o mostrarte productos que creemos que pueden interesarte. No guardamos ninguna información vinculada directamente a ti, como los datos de la tarjeta de crédito. También utilizamos cookies de socios cuidadosamente seleccionados con los que trabajamos y que promocionan nuestros servicios en sus páginas.</p>\n<p>Entonces, ¿por qué avisarte sobre las cookies? Existe una nueva ley de la UE que obliga a ofrecer al usuario una amplia información respecto a las cookies y, en caso de necesitar saber más, no dudes en ponerte en contacto con nosotros.</p>\n<p>Aquí te dejamos algunas respuestas a preguntas que te puedes hacer antes, durante o después del proceso de compra. Y si aun así tienes dudas, llámanos al teléfono 915 123 134 o mándanos un email. Te daremos una solución inmediata.</p>\n'),
