(173, 1, '2020-11-30 17:41:39', '2020-11-30 16:41:39', '<label>[text* your-name placeholder \"nombre*\"] </label>\r\n<label>[email* your-email placeholder \"email*\"] </label>\r\n<label>[tel tel-72 placeholder \"Teléfono\"] </label>\r\n<label>[text* your-subject placeholder \"Asunto*\"] </label>\r\n<label>[textarea* your-message placeholder \"Mensaje*\"] </label>\r\n[submit \"Enviar\"]\n1\n[_site_title] «[your-subject]»\n[_site_title] <no-reply@jorge2.imaisd.es>\n[_site_admin_email]\nDe: [your-name] <[your-email]>\r\nAsunto: [your-subject]\r\nTeléfono:\r\n[tel-72]\r\n\r\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n-- \r\nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] «[your-subject]»\n[_site_title] <wordpress@jorge2.imaisd.es>\n[your-email]\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n-- \r\nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nGracias por tu mensaje. Ha sido enviado.\nHa ocurrido un error al intentar enviar tu mensaje. Por favor, inténtalo de nuevo más tarde.\nUno o más campos tienen un error. Por favor, revísalos e inténtalo de nuevo.\nHa ocurrido un error al intentar enviar tu mensaje. Por favor, inténtalo de nuevo más tarde.\nDebes aceptar los términos y condiciones antes de enviar tu mensaje.\nEl campo es obligatorio.\nEl campo es demasiado largo.\nEl campo es demasiado corto.\nEl formato de fecha es incorrecto.\nLa fecha es anterior a la más temprana permitida.\nLa fecha es posterior a la más tardía permitida.\nHa ocurrido un error desconocido al subir el archivo.\nNo tienes permisos para subir archivos de este tipo.\nEl archivo es demasiado grande.\nHa ocurrido un error al subir el archivo.\nEl formato de número no es válido.\nEl número es menor que el mínimo permitido.\nEl número es mayor que el máximo permitido.\nLa respuesta al cuestionario no es correcta.\nLa dirección de correo electrónico que has introducido no es válida.\nLa URL no es válida.\nEl número de teléfono no es válido.', 'Formulario de contacto', '', 'publish', 'closed', 'closed', '', 'formulario-de-contacto-1', '', '', '2020-12-03 18:40:18', '2020-12-03 17:40:18', '', 0, 'http://jorge2.imaisd.es/?post_type=wpcf7_contact_form&#038;p=173', 0, 'wpcf7_contact_form', '', 0),
