(336, 1, '2020-12-07 19:48:17', '2020-12-07 18:48:17', '<div class=\"main-container\">\r\n	<div class=\"container\">\r\n		<section class=\"section-cookies\">\r\n			<article>\r\n				<h1>POLÍTICA DE COOKIES</h1>\r\n				<div class=\"content\">\r\n					En mascotto utilizamos unos pequeños archivos de texto que se almacenan en tu ordenador, conocidos comúnmente como cookies. Éstas nos ayudan a hacer seguimientos sobre los productos que has guardado o añadido a la cesta de la compra y así poder recordarte cuando regreses a la página.\r\n\r\nPara hacer un pedido en Kiwoko.com, las cookies deberían estar habilitadas para un correcto funcionamiento. Sin embargo, si lo único que quieres es darte una vuelta por la página sin comprar, puedes deshabilitarlas con total libertad.\r\n\r\nUtilizamos cookies para ayudarte en tu recorrido por la web y las cookies que usamos son seguras. La información que recogemos con las cookies nos ayuda a identificar cualquier error que tengamos, o mostrarte productos que creemos que pueden interesarte. No guardamos ninguna información vinculada directamente a ti, como los datos de la tarjeta de crédito. También utilizamos cookies de socios cuidadosamente seleccionados con los que trabajamos y que promocionan nuestros servicios en sus páginas.\r\n\r\nEntonces, ¿por qué avisarte sobre las cookies? Existe una nueva ley de la UE que obliga a ofrecer al usuario una amplia información respecto a las cookies y, en caso de necesitar saber más, no dudes en ponerte en contacto con nosotros.\r\n\r\nAquí te dejamos algunas respuestas a preguntas que te puedes hacer antes, durante o después del proceso de compra. Y si aun así tienes dudas, llámanos al teléfono 915 123 134 o mándanos un email. Te daremos una solución inmediata.\r\n				</div>\r\n			</article>\r\n		</section>\r\n	</div>\r\n</div>', 'Cookies', '', 'publish', 'closed', 'closed', '', 'cookies', '', '', '2020-12-08 17:16:43', '2020-12-08 16:16:43', '', 0, 'http://jorge2.imaisd.es/?post_type=articles&#038;p=336', 0, 'articles', '', 0),
(337, 1, '2020-12-07 19:51:46', '2020-12-07 18:51:46', '<div class=\"main-container\">\n<div class=\"container\"><section class=\"section-cookies\"><article>\n<h1>POLÍTICA DE COOKIES</h1>\n<div class=\"content\">\n\nEn Mascotto utilizamos unos pequeños archivos de texto que se almacenan en tu ordenador, conocidos comúnmente como cookies. Éstas nos ayudan a hacer seguimientos sobre los productos que has guardado o añadido a la cesta de la compra y así poder recordarte cuando regreses a la página.Para hacer un pedido en Kiwoko.com, las cookies deberían estar habilitadas para un correcto funcionamiento. Sin embargo, si lo único que quieres es darte una vuelta por la página sin comprar, puedes deshabilitarlas con total libertad.\n\nUtilizamos cookies para ayudarte en tu recorrido por la web y las cookies que usamos son seguras. La información que recogemos con las cookies nos ayuda a identificar cualquier error que tengamos, o mostrarte productos que creemos que pueden interesarte. No guardamos ninguna información vinculada directamente a ti, como los datos de la tarjeta de crédito. También utilizamos cookies de socios cuidadosamente seleccionados con los que trabajamos y que promocionan nuestros servicios en sus páginas.\n\nEntonces, ¿por qué avisarte sobre las cookies? Existe una nueva ley de la UE que obliga a ofrecer al usuario una amplia información respecto a las cookies y, en caso de necesitar saber más, no dudes en ponerte en contacto con nosotros.\n\nAquí te dejamos algunas respuestas a preguntas que te puedes hacer antes, durante o después del proceso de compra. Y si aun así tienes dudas, llámanos al teléfono 915 123 134 o mándanos un email. Te daremos una solución inmediata.\n\n</div>\n</article></section></div>\n</div>', 'Article Cookies', '', 'inherit', 'closed', 'closed', '', '336-autosave-v1', '', '', '2020-12-07 19:51:46', '2020-12-07 18:51:46', '', 336, 'http://jorge2.imaisd.es/336-autosave-v1/', 0, 'revision', '', 0),
