(3, 'wc-admin-marketing-intro', 'info', 'en_US', 'Connect with your audience', 'Grow your customer base and increase your sales with marketing tools built for WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-27 14:47:08', NULL, 0, 'plain', '', 0, 'info'),
(4, 'wc-admin-onboarding-profiler-reminder', 'update', 'en_US', 'Welcome to WooCommerce! Set up your store and start selling', 'We\'re here to help you going through the most important steps to get your store up and running.', '{}', 'actioned', 'woocommerce-admin', '2020-11-27 11:47:08', NULL, 0, 'plain', '', 0, 'info'),
(5, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2020-11-22 09:47:08', NULL, 0, 'plain', '', 0, 'info'),
(6, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2020-11-22 09:47:08', NULL, 0, 'plain', '', 0, 'info'),
(7, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2020-11-22 09:47:08', NULL, 0, 'plain', '', 0, 'info'),
(10, 'wc-admin-mobile-app', 'info', 'en_US', 'Instala la aplicación móvil WooCommerce', 'Instala la aplicación móvil de WooCommerce para gestionar pedidos, recibir avisos de ventas y ver métricas clave – allí donde estés.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-29 15:44:04', NULL, 0, 'plain', '', 0, 'info'),
(12, 'wc-admin-launch-checklist', 'info', 'en_US', '¿Estás preparado para lanzar tu tienda?', 'Para asegurarnos de que nunca tengas esa sensación de «¿Qué se me olvidó?» hemos preparado la lista de comprobación esencial de despegue.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-30 14:47:45', NULL, 0, 'plain', '', 0, 'info'),
(13, 'wcpay-promo-2020-11', 'marketing', 'en_US', 'Manage subscriber payments from your store\'s dashboard', '<a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">WooCommerce Payments</a> now supports <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">WooCommerce Subscriptions</a>. <strong>Get 50% off transaction fees</strong> and make the most out of your holiday sales by adding WooCommerce Payments to your store. Limited-time offer. <br /><br /><em>By clicking \"Install now,\" you agree to our general <a href=\"https://wordpress.com/tos/\" target=\"_blank\">Terms of Service</a> and promotional <a href=\"https://woocommerce.com/terms-conditions/woocommerce-payments-promotion/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2020-11-26 20:29:27', NULL, 0, 'plain', '', 0, 'info'),
(14, 'wcpay-subscriptions-2020-11', 'marketing', 'en_US', 'Manage subscriber payments from your store\'s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2020-11-26 20:29:27', NULL, 0, 'plain', '', 0, 'info'),
(15, '-', 'info', 'en_US', 'Confirmar los ajustes de los impuestos', 'Los cálculos automatizados de impuestos están activos en tu tienda a través de WooCommerce Shipping &amp; Tax. Aprende más sobre la automatización de impuestos <a href=\"https://docs.woocommerce.com/document/woocommerce-services/#section-12\">aquí</a>.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-30 15:46:30', NULL, 0, 'plain', '', 0, 'info'),
(16, 'wc-admin-personalize-store', 'info', 'en_US', 'Personaliza la página de inicio de tu tienda', 'La página de inicio es uno de los puntos de entrada más importantes de tu tienda. Cuando se hace bien, puede dirigir a mayores conversiones y participación. No olvides personalizar la página de inicio que hemos creado para tu tienda durante el despegue.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-01 16:17:37', NULL, 0, 'plain', '', 0, 'info'),
(17, '-', 'info', 'en_US', 'Confirmar los ajustes de los impuestos', 'Los cálculos automatizados de impuestos están activos en tu tienda a través de WooCommerce Shipping &amp; Tax. Aprende más sobre la automatización de impuestos <a href=\"https://docs.woocommerce.com/document/woocommerce-services/#section-12\">aquí</a>.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-03 16:19:21', NULL, 0, 'plain', '', 0, 'info'),
(18, 'wc-admin-orders-milestone', 'info', 'en_US', '¡Enhorabuena por haber procesado 10 pedidos!', '¡Has logrado el hito de los 10 pedidos! Mira cómo vas. Ve algunas historias de éxito de WooCommerce para inspirarte.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-03 20:53:10', NULL, 0, 'plain', '', 0, 'info'),
(19, 'wc-admin-store-notice-giving-feedback-2', 'info', 'en_US', 'Da tu opinión', 'Ahora que nos has elegido como socio, nuestro objetivo es asegurarnos de que proporcionemos las herramientas adecuadas para satisfacer tus necesidades. Esperamos recibir tus comentarios sobre la experiencia de configuración de la tienda para que podamos mejorarla en el futuro.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-05 18:12:16', NULL, 0, 'plain', '', 0, 'info'),
(20, 'wc-admin-insight-first-sale', 'survey', 'en_US', '¿Sabías que?', 'Una tienda que funciona con WooCommerce necesita un promedio de 31 días para conseguir su primera venta. ¡Estás en el camino correcto! ¿Encontraste útil este tipo de estadística?', '{}', 'unactioned', 'woocommerce-admin', '2020-12-05 18:12:16', NULL, 0, 'plain', '', 0, 'info'),
(21, 'wc-admin-home-screen-feedback', 'info', 'en_US', 'Ayúdanos a mejorar la pantalla de inicio de WooCommerce', 'Nos encantaría saber tu opinión para dar forma al futuro de la pantalla de inicio de WooCommerce juntos. No dudes en compartir cualquier comentario, idea o sugerencia que tengas.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-09 14:47:41', NULL, 0, 'plain', '', 0, 'info');
